import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css'

function Work(){
    return(
        <div className="App">
           <h1 className="container">Projects</h1>
           <hr></hr>
           
            <wrapper id="cards">
            <a target="_blank" href="https://hayvant.github.io/giphymeetsmovies/">MoviesGiffys</a>
            <a target="_blank" href="https://fatimafbz.github.io/Weather-dashboard/">Weather Dashboard</a>
            <a target="_blank" href=" https://fatimafbz.github.io/work_Day_Scheduler/">Day Planner</a>
            <a target="_blank" href="https://lifetracker-project2.herokuapp.com/">LifeTracker</a>
            <a target="_blank" href=" https://techblog1a.herokuapp.com/">TechBlog</a>
            <a target="_blank" href="https://notetaker-fb.herokuapp.com/">NoteTaker</a>
            </wrapper>
       
        </div>
    )
}


export default Work;
